  false,\n\t\"url\": null,\n\t\"notes\": \"This Index is an update of the original
  INDEX published in 1970 (Collias, 1970). The principal additions to the original
  Index are the data obtained by a study of Skagit Bay for Seattle City Light (COllias,
  Barnes, and Lincoln, 1973), the study of the main basin of Puget Sound made for
  the Municipality of Metropolitan Seattle (METRO) (Collias and Lincoln, 1977) and
  a portion of the direction of Dr. T. S. English. This Index as well as the original
  1970 Index (Collias, 1970) report only those data obtained by water samplying techniques.
  No attempt has been made to catalog observations made by the newer electronic instruments
  (i.e., STD's and CTD's).\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
